import './Task.css'

function TaskCard({ready}){
    return <div className="card">
        <h1>Mi primer tarea</h1>{
            <span>
                style={ready ? {color: "Green"} : {color: "Red"}}
                {ready ? "Tarea realizada" : "Tarea pendiente"}
            </span>
        }
    </div>
}

export default TaskCard
